#3.2.1. H2, C3, C4 submechanisms
#The nature of a detailed chemical kinetic mechanism is intrinsically hierarchical. Since it has been a number of years since the work of Fisher et al. [E.M. Fisher, W.J. Pitz, H.J. Curran, C.K. Westbrook. Proc. Combust. Inst., 28 (2000), pp. 1579–1586], it was necessary to update the submechanisms on which the MB chemistry was added.
#* The H2/O2 submechanism has been replaced with that published by O'Conaire et al. [M. O'Conaire, H.J. Curran, J.M. Simmie, W.J. Pitz, C.K. Westbrook. Int. J. Chem. Kinet., 36 (2004), pp. 603–622].
#* The C3 submechanism has been replaced with that recently published by Petersen et al. [E.L. Petersen, D.M. Kalitan, S. Simmons, G. Bourque, H.J. Curran, J.M. Simmie Proc. Combust. Inst., 31 (2007), pp. 447–454 DOI: 10.1016/j.proci.2006.08.034].
#* An original C4 submechanism has been developed and added based on the work of Curran et al. [H.J. Curran, P. Gaffuri, W.J. Pitz, C.K. Westbrook; Combust. Flame, 114 (1998), pp. 149–177] and [H.J. Curran, P. Gaffuri, W.J. Pitz, C.K. Westbrook, Combust. Flame, 129 (2002), pp. 253–280] to account for C4 species observed in the experiments of Gail et al. [S. Gail, M.J. Thomson, S.M. Sarathy, S.A. Syed, P. Dagaut, P. Diévart, A.J. Marchese, F.L. Dryer. Proc. Combust. Inst., 31 (2007), pp. 305–311] and Sarathy et al. [S.M. Sarathy, S. Gail, S.A. Syed, M.J. Thomson, P. Dagaut. Proc. Combust. Inst., 31 (2007), pp. 1015–1022].description: |-
